  `payment_method` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `vnpay_txn_ref` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `payment_intent_id` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `payment_at` datetime DEFAULT NULL,
  `payment_metadata` json DEFAULT NULL,
  `platform_fee_percentage` decimal(5,2) DEFAULT NULL,
  `platform_fee_amount` decimal(10,2) DEFAULT NULL,
  `tutor_earnings` decimal(10,2) DEFAULT NULL,
  `commission_calculated_at` datetime DEFAULT NULL,
  `payout_id` bigint UNSIGNED DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `bookings_payout_id_foreign` (`payout_id`),
  KEY `bookings_student_id_is_confirmed_index` (`student_id`),
  KEY `bookings_tutor_id_is_confirmed_index` (`tutor_id`),
  KEY `bookings_start_time_end_time_index` (`start_time`,`end_time`),
  KEY `idx_tutor_payout` (`tutor_id`,`payout_id`),
  KEY `bookings_start_time_index` (`start_time`),
  KEY `bookings_created_at_index` (`created_at`),
  KEY `bookings_subject_id_foreign` (`subject_id`),
  KEY `bookings_status_index` (`status`),
  KEY `bookings_payment_status_index` (`payment_status`),
  KEY `bookings_status_payment_status_index` (`status`,`payment_status`)
) ENGINE=InnoDB AUTO_INCREMENT=212 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

