--
-- Cấu trúc bảng cho bảng `tutors`
--

DROP TABLE IF EXISTS `tutors`;
CREATE TABLE IF NOT EXISTS `tutors` (
  `id` bigint UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_id` bigint UNSIGNED NOT NULL,
  `bio` text COLLATE utf8mb4_unicode_ci,
  `hourly_rate` decimal(10,2) NOT NULL,
  `is_available` tinyint(1) NOT NULL DEFAULT '1',
  `experience_years` int DEFAULT NULL,
  `specialization` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `education` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `experience` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `certifications` json DEFAULT NULL,
  `is_verified` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `tutors_is_verified_index` (`is_verified`),
  KEY `tutors_hourly_rate_index` (`hourly_rate`),
  KEY `tutors_is_available_hourly_rate_index` (`is_available`,`hourly_rate`),
  KEY `tutors_experience_years_index` (`experience_years`),
  KEY `tutors_user_id_index` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Đang đổ dữ liệu cho bảng `tutors`
--

INSERT INTO `tutors` (`id`, `user_id`, `bio`, `hourly_rate`, `is_available`, `experience_years`, `specialization`, `education`, `experience`, `certifications`, `is_verified`, `created_at`, `updated_at`) VALUES
(1, 2, 'Experienced Mathematics tutor with a PhD in Applied Mathematics. I specialize in making complex concepts simple and enjoyable. My students consistently achieve excellent results in calculus, algebra, and statistics.', 180000.00, 1, 8, 'Advanced Calculus and Mathematical Analysis', NULL, NULL, NULL, 0, '2025-07-14 10:37:14', '2025-07-14 13:25:45'),
(2, 3, 'Passionate Chemistry educator with 6 years of teaching experience. I help students understand organic and inorganic chemistry through hands-on examples and real-world applications.', 95000.00, 1, 6, 'Organic Chemistry and Laboratory Techniques', NULL, NULL, NULL, 0, '2025-07-14 10:37:14', '2025-07-14 13:25:45'),
(3, 4, 'Physics PhD with expertise in both classical and quantum mechanics. I love breaking down complex physics problems into manageable steps and helping students develop problem-solving skills.', 140000.00, 1, 10, 'Classical and Quantum Physics', NULL, NULL, NULL, 0, '2025-07-14 10:37:14', '2025-07-14 13:25:45'),
(4, 5, 'English Literature graduate with a passion for writing and analysis. I help students improve their essay writing, reading comprehension, and critical thinking skills.', 95000.00, 1, 5, 'Literature Analysis and Creative Writing', NULL, NULL, NULL, 0, '2025-07-14 10:37:14', '2025-07-14 13:25:45'),
(5, 6, 'Computer Science professional with industry experience. I teach programming fundamentals, data structures, and help students prepare for technical interviews.', 290000.00, 1, 7, 'Programming and Data Structures', NULL, NULL, NULL, 0, '2025-07-14 10:37:14', '2025-07-14 13:25:45'),
(6, 7, 'Experienced Biology tutor with a Master\'s degree in Molecular Biology. I make complex biological processes easy to understand through visual aids and interactive learning.', 120000.00, 1, 6, 'Molecular Biology and Genetics', NULL, NULL, NULL, 0, '2025-07-14 10:37:14', '2025-07-14 13:25:45'),
(7, 8, 'Native Spanish speaker with teaching certification. I help students achieve fluency through immersive conversation practice and cultural understanding.', 80000.00, 1, 4, 'Spanish Language and Culture', NULL, NULL, NULL, 0, '2025-07-14 10:37:15', '2025-07-14 13:25:45'),
(8, 9, 'Economics PhD with experience in both academic and business settings. I teach microeconomics, macroeconomics, and help students understand economic principles.', 110000.00, 1, 9, 'Economics and Business Studies', NULL, NULL, NULL, 0, '2025-07-14 10:37:15', '2025-07-14 13:25:45'),
(9, 10, 'French language expert with native fluency. I offer comprehensive French instruction from beginner to advanced levels, focusing on grammar, conversation, and culture.', 85000.00, 1, 5, 'French Language and Literature', NULL, NULL, NULL, 0, '2025-07-14 10:37:15', '2025-07-14 13:25:45'),
(10, 11, 'Statistics and Data Science specialist with industry experience. I help students master statistical concepts, probability, and data analysis using real-world examples.', 250000.00, 1, 8, 'Statistics and Data Analysis', NULL, NULL, NULL, 0, '2025-07-14 10:37:15', '2025-07-14 13:25:45'),
(11, 12, 'Medical Doctor with expertise in anatomy and physiology. I help pre-med students understand complex biological systems and prepare for entrance exams.', 210000.00, 1, 12, 'Medical Sciences and MCAT Preparation', NULL, NULL, NULL, 0, '2025-07-14 10:37:15', '2025-07-14 13:25:45'),
(12, 13, 'History Professor with specialization in World History and American History. I make historical events come alive through storytelling and critical analysis.', 90000.00, 1, 15, 'World History and Historical Analysis', NULL, NULL, NULL, 0, '2025-07-14 10:37:15', '2025-07-14 13:25:45'),
(13, 14, 'Software Engineer with expertise in web development and algorithms. I teach modern programming languages and help students build real-world projects.', 300000.00, 1, 6, 'Web Development and Software Engineering', NULL, NULL, NULL, 0, '2025-07-14 10:37:15', '2025-07-14 13:25:45'),
(14, 15, 'Psychology graduate with research experience. I help students understand psychological theories, research methods, and statistical analysis in psychology.', 80000.00, 1, 4, 'Psychology and Research Methods', NULL, NULL, NULL, 0, '2025-07-14 10:37:15', '2025-07-14 13:25:45'),
(15, 16, 'Accounting professional with CPA certification. I teach financial accounting, managerial accounting, and help students prepare for professional exams.', 160000.00, 1, 7, 'Accounting and Financial Analysis', NULL, NULL, NULL, 0, '2025-07-14 10:37:15', '2025-07-14 13:25:45'),
